import React, {Component} from 'react';
import './list.css';
import Item from './item';

class List extends Component {

  constructor(props) {
    super(props);
    // lists
    this.state = {
      itemList: []
    }
    // temp maskInfo
    var tempMask = {img: 'Img', price: '1000', name: 'temp'};
    this.handleItem(tempMask) // first step
  }

  handleItem (maskInfo) {
    // parameter is sent by backend
    /* 
      it is dictionary which contains
      maskInfo.price, maskInfo.img, maskInfo.name
    */
    var temp = [];
    temp = this.state.itemList.copyWithin(); 
    //second step
    temp.push(<Item maskInfo = {maskInfo}/>);
    this.setState({
      itemList: temp
    })
    console.log(maskInfo.img)
  }
  
  render() {
    return (
      <div className = 'main-board'>
        <span>
        {this.state.itemList}
        </span>
        <span>
        {this.state.itemList}
        </span>
        <span>
        {this.state.itemList}
        </span>
      </div>
    );
  }
}

export default List
